        "X-RapidAPI-Host": "football98.p.rapidapi.com",
      },
    };

    fetch("https://football98.p.rapidapi.com/premierleague/table", options)
      .then((response) => response.json())
      .then((data) => {
        setData(data);
      })
      .catch((err) => console.error(err));
  }, []);
 
  console.log(data); */

  return (
    <div className="absolute top-0 left-[250px] h-screen w-[calc(100%-250px)] ">
      <div className="w-full h-full  ">
        <ul className="grid grid-cols-5 w-full h-full">
          <Link to="/leagues/premier">
            <li className=" group shadow-xl h-[100%] relative flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
              <h1
                className="hidden text-white group-hover:block absolute top-8"
                id="hide"
              >
                English Premier League
              </h1>
              <img src={Img1} className="w-[80%]"></img>
            </li>
          </Link>
          <Link to="/leagues/laliga">
            <li className=" group shadow-xl h-[100%] relative flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
              <h1
                className="hidden text-white group-hover:block absolute top-8"
                id="hide"
              >
                Spanish LaLiga
              </h1>
              <img src={Img2} className="w-[80%]"></img>
            </li>
          </Link>
          <Link to="/leagues/bundesliga">
            <li className=" group shadow-xl h-[100%] relative flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
              <h1
                className="hidden text-white group-hover:block absolute top-8"
                id="hide"
              >
                German Bundesliga
              </h1>
              <img src={Img3} className="w-[80%]"></img>
            </li>
          </Link>
          <Link to="/leagues/seriea">
            <li className=" group shadow-xl h-[100%] relative flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
              <h1
                className="hidden text-white group-hover:block absolute top-8"
                id="hide"
              >
                Italian Serie A
              </h1>
              <img src={Img4} className="w-[80%]"></img>
            </li>
          </Link>
          <Link to="/leagues/ligue1">
            <li className=" group shadow-xl h-[100%] relative flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
              <h1
                className="hidden text-white group-hover:block absolute top-8"
                id="hide"
              >
                France Ligue 1
              </h1>
              <img src={Img15} className="w-[80%]"></img>
            </li>
          </Link>
          <li className="h-[100%] flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
            <img src={Img6} className="w-[80%]"></img>
          </li>
          <li className="shadow-xl h-[100%] flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
            <img src={Img7} className="w-[80%]"></img>
          </li>
          <li className="h-[100%] flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
            <img src={Img8} className="w-[80%]"></img>
          </li>
          <li className="shadow-xl h-[100%] flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
            <img src={Img9} className="w-[80%]"></img>
          </li>
          <li className="h-[100%] flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
            <img src={Img10} className="w-[80%]"></img>
          </li>
          <li className="shadow-xl h-[100%] flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
            <img src={Img11} className="w-[80%]"></img>
          </li>
          <li className="h-[100%] flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
            <img src={Img12} className="w-[80%]"></img>
          </li>
          <li className="shadow-xl h-[100%] flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
            <img src={Img13} className="w-[80%]"></img>
          </li>
          <li className="h-[100%] flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
            <img src={Img14} className="w-[80%]"></img>
          </li>
          <li className="shadow-xl h-[100%] flex justify-center items-center transition-all hover:bg-yellow hover:bg-opacity-80 cursor-pointer">
            <img src={Img5} className="w-[80%]"></img>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Leagues;
